import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

import Footer from './components/Footer.js';
import HomePage from './pages/HomePage.js';

import './App.css';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      title: 'Joseph Wolff',
      headerLinks: [
        { title: 'Home', path: '/' },
        { title: 'About', path: '/about' },
        { title: 'Blog', path: '/blog' },
        { title: 'Contact', path: '/contact' }
      ],
      home: {
        title: 'Full Stack Web Developer',
        subTitle: 'Projects that inspire',
        selfDescription: 'Projects that convey limitless potential and an undying desire to learn new skills'
      },
      about: {
        title: 'About me',
        subTitles: [
          'Who am I?',
          'What do I do?',
          'How do I do it?',
          'What am I passionate about?'
        ],
        descriptions: [
          'Description of who I am professionally',
          'Description of what I do as a developer',
          'Description of how I do my work (technologies, organizational skills, etc.)',
          'Descriptions of professional passions for self development (Building web apps, Apps centered around nature, Ai, Ml, etc.)'
        ]
      },
      blog: {
        title: 'Welcome to my blog!'
      },
      cotact: {
        title: "Let's connect:",
        userFullName: '',
        userEmailAddress: '',
        userMessage: ''
      }
    }
  }

  render() {
    return (
      <Router>
        <Container className="p-0" fluid={true}>

          <Navbar className="border-bottom" bg="transparent" expand="lg">

            <Navbar.Brand>Joseph Wolff</Navbar.Brand>

            <Navbar.Toggle className="border-0" aria-controls="navbar-toggle" />
            <Navbar.Collapse id="navbar-toggle">

              <Nav className="ml-auto">
                <Link className="nav-link" to="/">Home</Link>
                <Link className="nav-link" to="/about">About</Link>
                <Link className="nav-link" to="/blog">Blog</Link>
                <Link className="nav-link" to="/contact">Contact</Link>

              </Nav>

            </Navbar.Collapse>

          </Navbar>

          <Route path="/" exact render={() =>
            <HomePage
              title={this.state.home.title}
              subTitle={this.state.home.subTitle}
              selfDescription={this.state.home.selfDescription}
            />}
          />

          <Route path="/about" exact render={() =>
            <AboutPage
              title={this.about.title}
              subTitles={this.state.about.subTitles}
              descriptions={this.state.about.descriptions}
            />}
          />

          <Route path="/blog" exact render={() =>
            <BlogPage
              title={this.state.blog.title}
            />}
          />

          <Route path="/contact" exact render={() =>
            <ContactPage
              title={this.state.contact.title}
            />}
          />

          <Footer />

        </Container>
      </Router>
    );
  }
}

export default App;
